function Page () {
    return (
        <div class="container">

            <nav>
                <p>Daily</p>
                <p>Weekly</p>
                <p>Calender</p>
            </nav>
            <ul>
                <li>Study for History exam</li>
                <li>Study for Chemistry exam</li>
                <li>Study for Biology exam</li>
            </ul>
        </div>
    );
};

export default Page;
